def check_user_email(email, rand_code):
    try:
        smtp_server = smtplib.SMTP("smtp.gmail.com", 587)
        smtp_server.starttls()
        smtp_server.login(SENDER_EMAIL, SENDER_PASSWORD)

        msg = MIMEMultipart()

        msg["From"] = SENDER_EMAIL
        msg["To"] = email
        msg["Subject"] = "Проверка эл. почты"

        html_text = f"""
                    <html>
                      <body>
                        <h1>Добрый день!</h1>
                        <p>Для регистрации на сайте необходимо ввести шестизначный пароль:</p>
                        <p style="font-size: 24px; font-weight: bold; margin: 10px 0;">{rand_code}</p>
                        <p>Никому не сообщайте этот код.</p>
                      </body>
                    </html>
                    """
        msg.attach(MIMEText(html_text, "html"))
        smtp_server.sendmail(SENDER_EMAIL, email, msg.as_string())
        smtp_server.quit()
        return True
    except Exception as exc:
        raise Exception(f'Error: {exc}')

async def check_company_name(company_tin):
    base_url = 'https://api-fns.ru/api/search'
    params={'q': company_tin,
            'key': API_FNS}
    try:
        async with httpx.AsyncClient() as client:
            response = await client.get(
                base_url, params=params
            )
    except Exception as exc:
        raise Exception(f'Error: {exc}')

    response_json = response.json()
    response_tin = response_json['items'][0]['ЮЛ']["ИНН"]

    if company_tin == response_tin:
        return True

    return False
